import React, { Component } from "react";
import Bullet from "./Bullet.js";

class Page extends Component {
  constructor(props) {
    super(props);

    this.state = {
      model: this.props.model
    }
  }

  render() {
    const bullets = this.state.model.children.map(child => {
      <Bullet model={ child }></Bullet>
    });

    return (
      <div className="container">
        <h1 className="display-1">{ this.state.model.content }</h1>
        <h1 className="display-5">{ this.state.model.note }</h1>
        <hr></hr>
        { bullets }
      </div>
    )
  }
}

export default Page;
